comments:
I'm a strange alerter. I like to watch my girl carefully for a minute to make sure before I let her know something is up.
Here I caught a bad bout of muscle lock up/spasms a few minutes before it actually happened. A diagnosis on the cause of these is currently on hold due to a loss of health insurance, but they might be a kind of seizure perhaps?
While she was already sitting down, it was good to give her a few minutes of warning beforehand.
Also, we watched the Netflix show Alias Grace, and we loved it!
